// Iterate through the regions & change Yorkshire's fill colour to gold
for (var i = 0; i < rsrGroups.length; i++) {

    // Change Yorkshire's fill colour to gold
    if (rsrGroups[i].data('id') == 'g7') {
        rsrGroups[i].node.setAttribute('fill', 'gold');
    }

    // Showing off
    rsrGroups[i].mouseover(function (e) {
        this.node.style.opacity = 0.7;
        document.getElementById('mouseText').value = this.data('id');
    });

    rsrGroups[i].mouseout(function (e) {
        this.node.style.opacity = 1;
    });

    rsrGroups[i].click(function (e) {
        this.node.style.backgroundColor = "white";
        this.node.style.color = "magenta";
    });
}










